      this.setState({
        jwt: JSON.stringify(response)

      })
    })
    .catch(err => {
      console.log(err);
    })
  }
  render() {
    return (
      <BrowserRouter>
        <div className="App">
          <Route path="/" exact component={() => <Home login={this.login} />} />
          <Route path="/account" exact component={() => <Account jwt={this.state.jwt} />} />
          <Route path="/depositwithdraws" exact component={DepositWithdraws} />
          <Route path="/login" exact component={Login} />
          <Route path="/register" exact component={Register} />
          <Route path="/checking" component={Checking} />
          <Route path="/savings" component={Savings} />
          <Route path="/cd" component={Cd} />
          <Route path="/transfer" component={Transfer} />
        </div>
